import React, { Component } from "react";
import Greet from './Greet'
import LeftSideBar from './LeftSideBar'
import Card from './Card'

class LeftBar extends Component {
  
  render() {
    debugger;
    var loadButton = this.props.location.aboutProps.load.z;
 
    return (
      <div class="container">
        <div class="row">
          <div class="col">
         <LeftSideBar/>
          </div>
          <div class="col-6">
              <Greet random={this.props}/>
          </div>
          <div class="col">
           <Card/>
          </div>
        </div>
      </div>
    );
  }
}

export default LeftBar;
